import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import { useNavigate } from 'react-router-dom';
import './styles.css';

export default function Assessment() {
  const [questions, setQuestions] = useState([]);
  const [answers, setAnswers] = useState({});
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [testId, setTestId] = useState(null);
  const [previousTests, setPreviousTests] = useState([]);
  const { token } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    if (!token) {
      navigate('/login');
    } else {
      fetchPreviousTests();
    }
  }, [token]);

  const fetchPreviousTests = async () => {
    try {
      const res = await fetch('http://localhost:8000/assessment/user-tests', {
        headers: { Authorization: `Bearer ${token}` }
      });
      const data = await res.json();
      setPreviousTests(data);
    } catch (err) {
      console.error('Error loading past tests:', err);
    }
  };

  const generateTest = async () => {
    setLoading(true);
    try {
      const response = await fetch('http://localhost:8000/assessment/generate-test', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });
      const data = await response.json();
      setQuestions(data.questions);
      setAnswers({});
      setResults(null);
      setTestId(data.test_id);
    } catch (err) {
      console.error('Failed to generate test:', err);
    } finally {
      setLoading(false);
    }
  };

  const submitTest = async () => {
    setLoading(true);
    try {
      const response = await fetch('http://localhost:8000/assessment/evaluate-test', {
        method: 'POST',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ test_id: testId, answers })
      });
      const result = await response.json();
      setResults(result);
      fetchPreviousTests(); // refresh history
    } catch (err) {
      console.error('Failed to submit test:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="assessment-layout">
      {/* Sidebar */}
      <aside className="sidebar">
        <h2>My Tests</h2>
        <ul className="test-list">
          {previousTests.map((test) => (
            <li key={test.test_id} onClick={() => setResults(test)}>
              <strong>{new Date(test.created_at).toLocaleDateString()}</strong>
              <div>Rule: {test.rule_based_score}%</div>
              <div>AI: {test.ml_based_score}/10</div>
            </li>
          ))}
        </ul>
        <button onClick={generateTest} className="generate-btn">
          {loading ? 'Loading...' : 'New Test'}
        </button>
      </aside>

      {/* Main Content */}
      <main className="main-content">
        {questions.length > 0 && !results && (
          <>
            <div className="questions-section">
              {questions.map((q, i) => (
                <div key={i} className="question-card">
                  <h3>Question {i + 1}: {q.text}</h3>
                  <div className="options">
                    {q.options.map((opt, j) => (
                      <label key={j} className="option">
                        <input
                          type="radio"
                          name={`q${i}`}
                          checked={answers[q.id] === j}
                          onChange={() => setAnswers({ ...answers, [q.id]: j })}
                        />
                        {opt}
                      </label>
                    ))}
                  </div>
                </div>
              ))}
            </div>
            <button
              onClick={submitTest}
              disabled={Object.keys(answers).length < questions.length}
              className="submit-btn"
            >
              {loading ? 'Evaluating...' : 'Submit Test'}
            </button>
          </>
        )}

        {/* Result Display */}
        {results && (
          <div className="results-section">
            <h2>Your Results</h2>
            <div className="score-card">
              <h3>Rule-Based Score</h3>
              <div className="score-value">{results.rule_based_score.toFixed(1)}%</div>
            </div>
            <div className="score-card">
              <h3>AI-Evaluated Score</h3>
              <div className="score-value">{results.ml_based_score.toFixed(1)}/10</div>
            </div>
            {results.feedback && (
              <div className="feedback">
                <h3>Overview</h3>
                <p>{results.feedback.overview}</p>
                <h3>Strengths</h3>
                <ul>
                  {results.feedback.strengths.map((s, i) => <li key={i}>{s}</li>)}
                </ul>
                <h3>Improvements</h3>
                <ul>
                  {results.feedback.improvements.map((s, i) => <li key={i}>{s}</li>)}
                </ul>
              </div>
            )}
          </div>
        )}
      </main>
    </div>
  );
}
